import johnVideosData from '../lib/John';
import markVideosData from '../lib/Mark';

interface LibraryModelProps {
  username: string;
}

const libraryModel = (props: LibraryModelProps) => {
  const { username } = props;
  const johnVideos = johnVideosData.videos;
  const markVideos = markVideosData.videos;

  if (username === "john") {
    return johnVideos;
  } 

  if (username === "mark") {
    return markVideos;
  }

  // Si le username ne correspond ni à "john" ni à "mark", vous pouvez retourner un tableau vide par défaut ou gérer l'erreur autrement
  return [];
}

export default libraryModel;
